import React from "react";

const ListTodo = ({ header, todos, deleteTodo }) => {
  return (
    <div>
      <h1>{header}</h1>
      <ul>
        {todos && todos.length > 0 ? (
          todos.map(todo => {
            if ((todo.progress = header)) {
              return (
                <li key={todo._id} onClick={() => deleteTodo(todo._id)}>
                  {todo.action}
                </li>
              );
            }
          })
        ) : (
          <li>No todo(s) left</li>
        )}
      </ul>
    </div>
  );
};

export default ListTodo;
